import React from "react";
import './style.css';

const Pion = () => {

    const changeColor = (e) => {
        if (e.target.classList.contains('styled')) {
            <div className="pion" style={{ backgroundColor: 'black' }}></div>
        }
        e.target.classList.add('styled')
    }

    return (
        <div className="pion" onClick={changeColor}>
            <div className="pion"></div>
            <div className="pion"></div>
            <div className="pion"></div>
            <div className="pion"></div>
            <div className="pion"></div>
        </div>
    )
}

export default Pion;
